import React, { useEffect, useState } from "react";
import axios from "axios";

const PendingApproval = () => {
  const [users, setUsers] = useState([]);
  const [roleSelections, setRoleSelections] = useState({});
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetchPendingUsers();
  }, []);

  const fetchPendingUsers = async () => {
    try {
      const res = await axios.get("/api/users");
      const pending = res.data.filter((user) => user.approved === false);
      setUsers(pending);
    } catch (err) {
      console.error("Error fetching users:", err);
    }
  };

  const handleApprove = async (userId) => {
    try {
      const role = roleSelections[userId] || "staff"; // default to staff
      await axios.patch(`/api/approvals/${userId}/approve`, { role });
      setMessage("User approved and email sent.");
      fetchPendingUsers();
    } catch (err) {
      console.error("Error approving user:", err);
      setMessage("Approval failed.");
    }
  };

  const handleReject = async (userId) => {
    try {
      await axios.patch(`/api/approvals/${userId}/reject`);
      setMessage("User rejected and email sent.");
      fetchPendingUsers();
    } catch (err) {
      console.error("Error rejecting user:", err);
      setMessage("Rejection failed.");
    }
  };

  const handleRoleChange = (e, userId) => {
    setRoleSelections({ ...roleSelections, [userId]: e.target.value });
  };

  return (
    <div className="container mt-4">
      <h2>ðŸš¦ Pending Approvals</h2>
      {message && (
        <div className={`alert ${message.includes("failed") ? "alert-danger" : "alert-success"}`}>
          {message}
        </div>
      )}
      <table className="table table-bordered mt-4">
        <thead className="thead-dark">
          <tr>
            <th>Email</th>
            <th>Phone</th>
            <th>Address</th>
            <th>Company</th>
            <th>Role</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {users.length === 0 ? (
            <tr>
              <td colSpan="6">No pending users.</td>
            </tr>
          ) : (
            users.map((user) => (
              <tr key={user._id}>
                <td>{user.email}</td>
                <td>{user.phone}</td>
                <td>{user.address}</td>
                <td>{user.companyName || "â€”"}</td>
                <td>
                  <select
                    className="form-select"
                    value={roleSelections[user._id] || ""}
                    onChange={(e) => handleRoleChange(e, user._id)}
                  >
                    <option value="">Select</option>
                    <option value="staff">Staff</option>
                    <option value="external_company">External Company</option>
                  </select>
                </td>
                <td>
                  <button onClick={() => handleApprove(user._id)} className="btn btn-success me-2">
                    Approve
                  </button>
                  <button onClick={() => handleReject(user._id)} className="btn btn-danger">
                    Reject
                  </button>
                </td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default PendingApproval;
